import React from 'react';
import Card from './Card';
const CardList = ({ robots }) => {
  return (
    <div>
      {robots.map((user, i) => {
        if (true) {
          throw new Error('noooooo');
        }
        return (
          <Card
            key={i}
            id={robots[i].id}
            name={robots[i].name}
            email={robots[i].email}
          />
        );
      })}
    </div>
  );
};

export default CardList;
